  false,\n\t\"url\": null,\n\t\"notes\": \"Ocean circulation and other data from SUBSURFACE
  FLOATS from the NE Atlantic (limit-40 W) and other locations. Data were collected
  by Woods Hole Oceanographic Institution (WHOI) as part of the World Ocean Circulation
  Experiment (WOCE) and other projects from 03 October 1984 to 03 June 1993. SOFAR,
  RAFOS, and ALACE submerged floats were deployed. Data are self documenting or are
  in the WHOI floater format and parameters include East-West current components (U),
  North-South current components (V), water temperature, and water pressure.\",\n\t\"owner_org\":
